import React from 'react';
import { Route , Switch } from 'react-router-dom';
import About from './About';
import Contact from './Contact';

const App = ()=>{
     return (
          <>
          {/* <Switch> */}
               <Routes  path='/' component={About}/>
               <Routes  path='/contact' component={Contact}/>  
          {/* </Switch>   */}
          </>
     )
}

export default App;
